schemaDefinition: "create or replace view X_SNC_CP_CORRAL(\n\t\"SysId\",\n\t\"TypeSysId\"\
  ,\n\t\"Type\",\n\t\"Active\",\n\t\"Name\",\n\t\"Description\",\n\t\"BusinessUnit\"\
  ,\n\t\"BusinessUnitSysId\",\n\t\"UAcvScore\",\n\t\"SysModCount\",\n\t\"DisplayName\"\
  ,\n\t\"UpperValue\",\n\t\"UnitSyId\",\n\t\"Unit\",\n\t\"SysTags\",\n\t\"SysCreatedOn\"\
  ,\n\t\"SysCreatedBy\",\n\t\"SysUpdatedOn\",\n\t\"SysUpdatedBy\",\n\t\"PspPerInsertDt\"\
  ,\n\t\"PspPerUpdateDt\",\n\t\"PspPerDeleteDt\"\n) as -- SEMANTIC LAYER BEGINS\n\n\
  SELECT \"SYS_ID\" as \"SysId\",\n       \"TYPE\" as \"TypeSysId\",\n       \"DV_TYPE\"\
  \ as \"Type\",\n       \"ACTIVE\" as \"Active\",\n       \"NAME\" as \"Name\",\n\
  \       \"DESCRIPTION\" as \"Description\",\n       \"DV_BUSINESS_UNIT\" as \"BusinessUnit\"\
  ,\n       \"BUSINESS_UNIT\" as \"BusinessUnitSysId\",\n       \"U_ACV_SCORE\" as\
  \ \"UAcvScore\",\n       \"SYS_MOD_COUNT\" as \"SysModCount\",\n       \"DISPLAY_NAME\"\
  \ as \"DisplayName\",\n       \"UPPER_VALUE\" as \"UpperValue\",\n       \"UNIT\"\
  \ as \"UnitSyId\",\n       \"DV_UNIT\" as \"Unit\",\n       \"SYS_TAGS\" as \"SysTags\"\
  ,\n       \"SYS_CREATED_ON\" as \"SysCreatedOn\",\n       \"SYS_CREATED_BY\" as\
  \ \"SysCreatedBy\",\n       \"SYS_UPDATED_ON\" as \"SysUpdatedOn\",\n       \"SYS_UPDATED_BY\"\
  \ as \"SysUpdatedBy\",\n       \"PSP_PER_INSERT_DT\" as \"PspPerInsertDt\",\n  \
  \     \"PSP_PER_UPDATE_DT\" as \"PspPerUpdateDt\",\n       \"PSP_PER_DELETE_DT\"\
  \ as \"PspPerDeleteDt\"\nFROM \"RDS\".\"SURF\".\"X_SNC_CP_CORRAL\";"
